// frontend/src/routes/HRRoutes.jsx
import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import HRDashboard from '../components/HR/HRDashboard';
import JobManagement from '../components/HR/JobManagement';
import CreateJobForm from '../components/HR/CreateJobForm';
import EditJobForm from '../components/HR/EditJobForm';
import CompanyList from '../components/HR/CompanyList';
import ApplicationList from '../components/HR/ApplicationList';

const HRRoutes = () => {
  return (
    <Routes>
      {/* HR Dashboard - หน้าหลัก */}
      <Route path="/" element={<HRDashboard />} />
      <Route path="/dashboard" element={<HRDashboard />} />
      
      {/* Job Management Routes */}
      <Route path="/jobs" element={<JobManagement />} />
      <Route path="/jobs/create" element={<CreateJobForm />} />
      <Route path="/jobs/edit/:jobId" element={<EditJobForm />} />
      
      {/* Application Management */}
      <Route path="/applications" element={<ApplicationList />} />
      <Route path="/jobs/:jobId/applications" element={<ApplicationList />} />
      
      {/* Company List */}
      <Route path="/companies" element={<CompanyList />} />
      
      {/* Redirect any unknown paths to dashboard */}
      <Route path="*" element={<Navigate to="/hr/dashboard" replace />} />
    </Routes>
  );
};

export default HRRoutes;
